class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        one = []
        two = []
        three = -(10**10)
        n = len(board)
        m = len(board[0])
        for i in range(n):
            for j in range(m):
                for v, p in two:
                    if p[0] != j and p[1] != j:
                        three = max(three, v + board[i][j])
                        break
            for j in range(m):
                for v, p in one:
                    if p != j:
                        q = (min(p, j), max(p, j))
                        two.append((v + board[i][j], q))
            two.sort(reverse=True)
            s = set()
            n_two = []
            for p in two:
                if p[1] in s:
                    continue
                s.add(p[1])
                n_two.append(p)
            two = n_two
            while len(two) > n:
                two.pop()
            for j in range(m):
                one.append((board[i][j], j))
            one.sort(reverse=True)
            s = set()
            n_one = []
            for p in one:
                if p[1] in s:
                    continue
                s.add(p[1])
                n_one.append(p)
            one = n_one
            while len(one) > 3:
                one.pop()
            # print(one, two, three)
        return three
